import React, { useState, useEffect } from 'react';
import Axios from 'axios';

function Home() {
  const [vehicles, setVehicles] = useState([]);

  useEffect(() => {
    Axios.get('http://127.0.0.1:8000/api/vehicles/')
      .then((response) => {
        setVehicles(response.data);
      })
      .catch((error) => {
        console.error('Error fetching vehicle data:', error);
      });
  }, []);

  return (
    <div className="container mt-5">
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <a className="navbar-brand" href="/">VehicleVerse</a>
      </nav>
      <h1 className="mt-4 text-center">Vehicle Listings</h1>
      <div className="row">
        {vehicles.map((vehicle) => (
          <div key={vehicle.id} className="col-md-4">
            <div className="card mb-4">
              <img src={vehicle.image} className="card-img-top" alt="Vehicle" />
              <div className="card-body">
                <h5 className="card-title">Vehicle Type: {vehicle.vehicle_type}</h5>
                <p className="card-text">Make: {vehicle.make}</p>
                <p className="card-text">Model: {vehicle.model}</p>
                <p className="card-text">Year: {vehicle.year}</p>
                <p className="card-text">Phone Number: {vehicle.phone_number}</p>
                <p className="card-text">Price: {vehicle.price}</p>
                <p className="card-text">Description: {vehicle.description}</p>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Home;
